import React from 'react';
import { NavLink } from 'react-router-dom';
const Contact=()=>{
   
    return(

        <>
            <div className="setStyle2">
                <h1>Contact Page.....</h1>
                <br />
                <NavLink to="/" className="lily">Go Back To Home</NavLink>
             
                
            </div>
        </>
    )
}
export default Contact;
